            modelBuilder.Entity<Review>().HasData(
                new { Id = 1, BookId = 1, Reviewer = "Cid Herman", Message = "The style of writing and the language are not of this time (or country) so it took me a little bit to get into the rythmn. After a while it reads just like any modern story with no rereading necessary. I haven't read a classic in ages, but I loved A Tale of Two Cities. It is actually frightening how brutal human beings can be. The story unfolds with amazing clarity for the absolute madness that takes place in the novel. It is also eerily relevant to our times, and actually to all times throughout history when the wealthy got rich off the backs of the poor. This historical novel makes abundantly clear: You can only exploit people for so long, and eventually angry, scared, HUNGRY, and impoverished people will rise up; then there will be lives lost on both sides. Oppression and laws that favor only the wealthy will never be a long term solution for any style of government that works . This book is more like an ALARM for future generations than it is a 'cautionary tale'. I am so glad I read it, because it verbalized everything I already thought about the consequences of disregarding the fundamental rights and most basic needs of other human beings. Yikes! History has some scary scary lessons. French aristocracy paid a huge price for reducing the common man to desperation. The problem is when payback comes, it turns those that destroy into monsters themselves, no better than those who they were hellbent on destroying. The madness described by Charles Dickens is not for the faint of heart. It is graphic and violent, but so very eloquently told. Its a history lesson brought to life, full of color (the color of blood) and it makes you look at what man is capable of... It's not pretty. History will repeat itself again and again apparently." },
                new { Id = 2, BookId = 1, Reviewer = "Amanda Adams", Message = "It's 10th grade and my English class is assigned to read one of a small handful of the 'classics'. I chose A Tale of Two Cities for no apparent reason whatsoever. I had been a reader all my life up to that point but this was my first classic book and the first book since Black Beauty that made me feel something. I thought about this story almost every minute that I didn't have my nose in it and I was truly sad when I had finished it. I loved it but I wasn't really into Beverly Hills 90210 so no shocker there." },
                new { Id = 3, BookId = 2, Reviewer = "Erin", Message = "We are all children in adult bodies. Yes we are, don't think we aren't for one moment. The fact that we WERE, indeed, children, is a huge part of each of us. It is possible to shed a few appreciative tears on every page of this book if you entertain the thought that the pilot IS The Little Prince. Maybe you won't think that--maybe you'll have your own take on the book---that's the magic about it. This book is translated to English from French. If you understand and/or appreciate French, the deliciousness of that fact can affect you in addition to the sweet storyline itself. The book won't even take you a whole day to read. Consider honoring the Little You that still remains, and resides within you, and read this salute to childhood, to innocence, and to you. It just takes a 'Little' imagination and bravery." },
                new { Id = 4, BookId = 2, Reviewer = "Hailey", Message = "So amazing. I can see many rereads of this in the years to come." },
                new { Id = 5, BookId = 3, Reviewer = "Jaden McNally", Message = "I once heard an interview with someone saying that it was changed because they didn't think American children would want to read it as much if it had a long word like 'Philosopher' in it. They thought 'Sorcerer' would better catch the attention of young, American readers." },
                new { Id = 6, BookId = 4, Reviewer = "chai ♡", Message = "There is scarcely any comfort to be found in this book, only an ancient, arcane horror. Even my most harrowing nightmares would have never conjured such a soul-fearing tale. And Then There Were None was uncomfortable as it lodged itself in the darkest corner of my mind, and the questions it asks and the implications it conceals are still twining up my legs like a barbed vine." },
                new { Id = 7, BookId = 5, Reviewer = "Matthias", Message = "If you would have asked me a couple of weeks ago what I think a time machine looks like, I would have described a greyish blue metallic construction with a little blinking light for every button and a button for every wire that sparks within the machine's smooth frame. Maybe little bleeps and sounds too, and definitely a smoke generator because no time travel is complete without that puff of smoke signifying take-off to another time. Teams of scientists would be peering over this equipment armed with notes and calculations, trying to make sense of the complicated affair." },
                new { Id = 8, BookId = 7, Reviewer = "Joel", Message = "I want to go back and rate them individually, due to all the ravings about how awful the last three books are vs the genius of the first four (and there is certainly a difference but not too much) but for now I must say that this series is life changing as a whole. If you make it past the first book you will be hooked into the Tower story and will carry on with Roland until the end, which itself serves as another place of polarizing opinion (I fall on the side that the ending was perfect,the very end anyways, the Crimson King part not so much) among all the fans. The series changes the way you view the universe, storytelling, character and even the way you speak. I don't know what else you could want out of series that crosses all genres and is vastly different from King's body of work but it holds one thing in common, it is vastly entertaining throughout." },
